import React, {useState} from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';



const useStyles = makeStyles((theme) => ({
    paper: {
        marginTop: theme.spacing(8),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: theme.palette.secondary.main,
    },
    form: {
        width: '100%', // Fix IE 11 issue.
        marginTop: theme.spacing(3),
    },
    submit: {
        margin: theme.spacing(3, 0, 2),
    },
}));

export default function Query1Form() {
    const classes = useStyles();

    const useInput = initialValue => {
        const [value, setValue] = useState(initialValue);

        return {
            value,
            setValue,
            reset: () => setValue(""),
            bind: {
                value,
                onChange: event => {
                    setValue(event.target.value);
                }
            }
        };
    };

    const {value:author, bind:bindAuthor, reset:resetAuthor} = useInput('');
    const {value:dateFrom, bind:bindDateFrom, reset:resetDateFrom} = useInput('');
    const {value:dateTo, bind:bindDateTo, reset:resetDateTo} = useInput('');
    const {value:count, bind:bindCount, reset:resetCount} = useInput('');


    const handleSubmit = (event) => {
        event.preventDefault();
        let state = {
            author: author,
            dateFrom: dateFrom,
            dateTo: dateTo,
            count: count,
        };

        var url = new URL("http://localhost:5000/query1"),
            params = {author: author, date_from: dateFrom, date_to: dateTo, count: count};
        Object.keys(params).forEach(key => url.searchParams.append(key, params[key]))
        fetch(url)
            .then(res => res.json())
            .then(
                (result) => {
                    // setIsLoaded(true);
                    // setOrders(result);
                    console.log(result);
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    // setIsLoaded(true);
                    // setError(error);
                }
            )
    };

    return (
        <Container component="main" maxWidth="xs">
            <CssBaseline />
            <div className={classes.paper}>
                <Typography component="h1" variant="h5">
                    Введіть необхідні дані
                </Typography>
                <form className={classes.form} noValidate onSubmit={handleSubmit}>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField
                                variant="outlined"
                                required
                                fullWidth
                                id="author"
                                label="Прізвище Автора"
                                name="authore"
                                autoComplete="author"
                                {...bindAuthor}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                variant="outlined"
                                required
                                fullWidth
                                id="dateFrom"
                                label="Початкова дата"
                                name="Date From"
                                autoComplete="Date From"
                                {...bindDateFrom}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                variant="outlined"
                                required
                                fullWidth
                                id="dateTo"
                                label="Кінцева дата"
                                name="Date To"
                                autoComplete="Date To"
                                {...bindDateTo}
                            />

                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                variant="outlined"
                                required
                                fullWidth
                                id="count"
                                label="Кількість"
                                name="Count"
                                autoComplete="Count"
                                {...bindCount}
                            />
                        </Grid>
                    </Grid>
                    <Button
                        type="submit"
                        fullWidth
                        variant="contained"
                        color="primary"
                        className={classes.submit}
                    >
                        Отримати
                    </Button>
                </form>
            </div>
        </Container>
    );
}
